import React from 'react';
import Tribe from './assets/Tribe.png'
import Container from '@mui/material/Container'
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';



const Index = () => {
  return( 
    <>  
        <Container>
            <Grid container>
                <Grid item sm={6} style={{marginTop: 20}} container><img src={Tribe} alt='tribe' /></Grid>
                <Grid item sm={6} justifyContent='flex-end'><h1 className='index-header'>Hello</h1></Grid>
            </Grid>
        </Container>
    </>
    )
};

export default Index;
